import React, { Component } from 'react';
import { withRouter } from 'react-router-dom';
import {
  createMatcher,
  isFaceDetectionModelLoaded
} from '../api/face';
import { JSON_PROFILE } from '../common/profile';

const INIT_STATE = {
  url: null,
  imageURL: null,
  fullDesc: null,
  imageDimension: null,
  error: null,
  loading: false
};

class CaracteristicasFoto extends Component {
  constructor(props) {
    super(props);
    this.state = {
      ...INIT_STATE,
      faceMatcher: null,
      showDescriptors: false,
      isModelLoaded: !!isFaceDetectionModelLoaded(),
      caracteristicas: null
    };
  }

  componentDidMount() {
    axios.get('../json/caracteristicasFoto.json').then( res => {
      this.setState({ caracteristicas: res.data })
    })
  }

  componentWillMount() {
    this.resetState();
  }


  matcher = async () => {
    const faceMatcher = await createMatcher(await JSON_PROFILE());
    this.setState({ faceMatcher });
  };

  handleFileChange = async event => {
    this.resetState();
    if(event.target.files.length > 0){
      await this.setState({
        imageURL: URL.createObjectURL(event.target.files[0]),
        loading: true
      });
      this.handleImageChange();
    }
  };

  handleURLChange = event => {
    this.setState({ url: event.target.value });
  };

  handleButtonClick = async () => {
    this.resetState();
    let blob = await fetch(this.state.url)
      .then(r => r.blob())
      .catch(error => this.setState({ error }));

    if (!!blob && blob.type.includes('image')) {
      this.setState({
        imageURL: URL.createObjectURL(blob),
        loading: true
      });
      this.handleImageChange();
    }
  };


  handleDescriptorsCheck = event => {
    this.setState({ showDescriptors: event.target.checked });
  };

  resetState = () => {
    this.setState({ ...INIT_STATE });
  };
  render() {

    return (
      <div style={{
          display: 'flex',
          flexDirection: 'column',
          alignItems: 'center'
        }}
      >
        <div
          style={{
            position: 'relative'
          }}
        >
          <table>
            <tr>
              <th>Nombre Cliente</th>
              <th>Edad</th>
              <th>Sexo</th>
              <th>Estado Emocional</th>
            </tr>
            <tr>
              <td>Victor Villacorta</td>
              <td>30</td>
              <td>Male</td>
              <td>Neutral</td>
            </tr>
            <tr>
              <td>Javier Cuicapuza</td>
              <td>28</td>
              <td>Male</td>
              <td>Happy</td>
            </tr>
            <tr>
              <td>Jhosep Vega</td>
              <td>36</td>
              <td>Male</td>
              <td>Happy</td>
            </tr>
            <tr>
              <td>Jonathan Quiza</td>
              <td>27</td>
              <td>Male</td>
              <td>Neutral</td>
            </tr>
            <tr>
              <td>Rosa Soto</td>
              <td>27</td>
              <td>Female</td>
              <td>Happy</td>
            </tr>
          </table>
        </div>

      </div>
    );
  }
}

export default withRouter(CaracteristicasFoto);
